import React from "react";

const LoginPage = () => {
    return (
        <div className="form">
            <h2>Login Form</h2>
            <div className="form form--login">
                <input type="email" placeholder="youremaill@gmail.com" name="email"/>
                <input type="password" name="password"/>
            </div>
        </div>
    )
}

export default LoginPage;
